import './App.css';
import React from "react";
import Navbar from './components/Navbar';


function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api/tareas")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);
  return (
    <div> 
      <Navbar brand="Lista de Imaginantes"/> 
      <p>{!data ? "Loading..." : data}</p>
    </div>


  );
}

export default App;
